define(function(require, exports, module) {
	module.exports = function(view, view, stc, svc) {
		var _vm = null ;
		require('../styles/seckill.special.css') ;
        new (require('../../components/activity.js'))(svc) ;
		view.m_on("init", function() {
			_vm = view.m_vm({
				data : {
					title : "秒杀专场",
					image_bg : 'data:image/jpg;base64,',
					timeline_list : [],
					share : {},
					current_time : null,
					current_index : 0,
                    activity : {},
                    isrecommend : 1,
					renders : {
						default : {
							model : {
								list : []
							},
							ondraw : function() {
								return new Promise(function(next, fail) {
									// 获取时间列表
									app.service.seckill.m_timeline(function(ds) { // 请求时间
										_vm.current_time = ds.data.current ;
										_vm.timeline_list = ds.data.list ;
										for(var i = 0; i < _vm.timeline_list.length; i++) {
											if(_vm.timeline_list[i].time == _vm.current_time) {
												_vm.current_index = i ;
												break ;
											}
										}
										app.service.seckill.m_special({
											time : _vm.current_time
										}, function(ds) {
											next({
												list : ds.data.list
											}) ;
										}, fail) ;
									}) ;
									
								})
							},
							ondraw_after : function(data) {
								var _e_li = $$('.allow-scroll ul li').eq(_vm.current_index) ;
								$$('.allow-scroll').prop('scrollLeft', _e_li.position().left) ;
							}
						}
					}
				},
				methods : {
					m_activity : function() {
						function _m() {
							setTimeout(function() {
								_vm.m_pop_recommend() ;	
							}, 1500) ;
						}
						var _query = app.m_query() ;
						if(_query.member_id) {
			            	app.vm.quickreg.params.onfinish = function() {
			                    _m() ;
			                }
			                app.vm.redpackage.params.onclose = function() {
			                    _m() ;
			                }
			            } else {
			            	_m() ;
			            }
					},
					m_share : function() {
						app.vm.share.m_show({
							url : window.location.href,
							imgurl : 'http://o86ac3exs.bkt.clouddn.com/seckill.png',
							title : '古美术秒杀专场',
							desc : '全场藏品秒杀中, 快来看看！！！'
						}) ;
					},
					m_filter : function() { // 过滤
						app.loader.m_show(120) ;
						app.service.seckill.m_special({
							time : this.current_time
						}, function(ds) {
							app.loader.m_hide() ;
							_vm.$model.list = ds.data.list ;
						}) ;
					},
					m_push : function(el) {
						var _id = el.entityId ;
						return 'seckill.list?id=' + _id ;
					},
					m_hide_recommend : function() {
						this.isrecommend = 0 ;
					},
                    m_pop_recommend : function() {
                    	app.service.activity.m_get(function(ds) {
                    		console.log(ds) ;
                            _vm.activity.m_show({
                                picture_url : 'data:image/jpg;base64,',
                                title : '为您推荐',
                                desc : ds.data.title + '￥' + ds.data.price,
                                viewname : 'activity.detail'
                            }) ;
						}) ;
                    	// 返回
                    }
				}
			}) ;
		}) ;
		view.m_on("draw", function() {
			/* 每当模板渲染时触发 */
			_vm.isrecommend = 1 ;
			_vm.m_activity() ;
			return _vm.m_refresh() ;
		}) ;

		view.m_on("active", function() {
			/* 当 view 激活时触发(在 enter 事件之前, 简单点说如果有过度动画, 将会在过度之前触发) */	
		}) ;

		view.m_on("enter", function() {
			/* 当 view 进入时触发 */	
		}) ;

		view.m_on("frozen", function() {
			/* 当 view 失效时触发 (如果有过度动画, 将会在过度之前触发) */	
		}) ;

		view.m_on("leave", function() {
			/* 当 view 离开时触发 (如果有过度动画, 将会在过度之后触发) */
		}) ;

		view.m_on("message", function(ev, msg) {
			/* 当 view 进入后, 从消息队列中获取消息列表, 循环触发 */
			// ev 事件源
			// msg 消息对象 属性: name, params
			switch(msg.name) {
				case "<name>" : { // 监视消息名称
					// ... 
					break ;
				}
			}
		}) ;
	}
}) ;